ЦБ усилит контроль за переводами граждан и начнет принимать доносы.

По инструкции ЦБ, банки должны будут блокировать «подозрительные» транзакции и расторгать договор с клиентом. Помимо этого, теперь можно писать доносы на теневых собственников кредитных организаций.
